import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import PropTypes from 'prop-types';

function Email({ details }) {
    return (
        <div>
            <Button />
            <div>
                <Sender from={details.from} />
                <Subject subject={details.sub} />
                <Date date={details.date} />
            </div>
            <div>
                <Message body={details.body} />
            </div>
        </div>
    );
}

const Button = () => {};

function Sender({ from }) {
    return <div>{from}</div>;
}

function Subject({ subject }) {
    return <div>{subject}</div>;
}

function Date({ date }) {
    return <div>{date}</div>;
}

function Message({ body }) {
    return <div>{body}</div>;
}

let details = {
    from: 'React Newsletter',
    sub: 'React Newsletter - Issue 36',
    date: 'Jul 15',
    body:
        'React Newsletter Issue -36 - July 15th 2016 Read this issue on the web http://react/newsletter.com/issues/36?'
};

ReactDOM.render(<Email details={details} />, document.getElementById('root'));
